public class InnerCampaignMessageConfigurationFactory(Action<Humidifier.Pinpoint.CampaignTypes.MessageConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Pinpoint.CampaignTypes.MessageConfiguration>
{

    internal InnerCampaignMessageFactory APNSMessageFactory { get; set; }

    internal InnerCampaignMessageFactory BaiduMessageFactory { get; set; }

    internal InnerCampaignMessageFactory DefaultMessageFactory { get; set; }

    internal InnerCampaignCampaignInAppMessageFactory InAppMessageFactory { get; set; }

    internal InnerCampaignCampaignEmailMessageFactory EmailMessageFactory { get; set; }

    internal InnerCampaignMessageFactory GCMMessageFactory { get; set; }

    internal InnerCampaignCampaignSmsMessageFactory SMSMessageFactory { get; set; }

    internal InnerCampaignCampaignCustomMessageFactory CustomMessageFactory { get; set; }

    internal InnerCampaignMessageFactory ADMMessageFactory { get; set; }

    protected override Humidifier.Pinpoint.CampaignTypes.MessageConfiguration Create()
    {
        var messageConfigurationResult = CreateMessageConfiguration();
        factoryAction?.Invoke(messageConfigurationResult);

        return messageConfigurationResult;
    }

    private Humidifier.Pinpoint.CampaignTypes.MessageConfiguration CreateMessageConfiguration()
    {
        var messageConfigurationResult = new Humidifier.Pinpoint.CampaignTypes.MessageConfiguration();

        return messageConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Pinpoint.CampaignTypes.MessageConfiguration result)
    {
        base.CreateChildren(result);

        result.APNSMessage ??= APNSMessageFactory?.Build();
        result.BaiduMessage ??= BaiduMessageFactory?.Build();
        result.DefaultMessage ??= DefaultMessageFactory?.Build();
        result.InAppMessage ??= InAppMessageFactory?.Build();
        result.EmailMessage ??= EmailMessageFactory?.Build();
        result.GCMMessage ??= GCMMessageFactory?.Build();
        result.SMSMessage ??= SMSMessageFactory?.Build();
        result.CustomMessage ??= CustomMessageFactory?.Build();
        result.ADMMessage ??= ADMMessageFactory?.Build();
    }

} // End Of Class

